    false,nt"url": null,nt"notes": "This Comprehensive Conservation Plan (CCP)
    was written to guide management on D'Arbonne NWR for the next 15 years. This plan
    outlines the Refuge vision and purpose and describes how D'Arbonne NWR will contribute
    to the overall mission of the Refuge System. The plan provides an introduction to
    the Refuge, an overview of the CCP process, and information about the management
    direction and plan implementation. Key planning issues include: fish and wildlife
    populations management, habitat management, visitor services, and Refuge administration.",nt"owner_org":
